window.bookSummaryJSON = "<p>I am going to die.</p> <p>What was once my mates' curse is now killing me, but I will never give up on our eternity.</p> <p>War is coming. Our enemies won't stop until my mates and I are deadâ€”our magic wiped from the face of the Otherworld. Extinction is the only thing they will accept.</p> <p>I may be new to this world, but it's mine now. No matter what, I won't let it fall into their hands. The Alphas will pay for what they've done. To me. To my mates. To the wolves they were meant to protect.</p> <p>This new curse is taking hold, stealing my life piece by piece. But that only makes me more dangerous. I will protect my lovers and my home, even with my last breath. I'm ready.</p> <p>Let them come. Let them try to kill me. Let them watch the witch they tried to burn become a Queen.</p> <p>Contains mature themes.</p>"; 
